lication-specific problem solving.','http://computing.ornl.gov/cse_home/cms/conference/index.shtml',2009),(12908,1,'15393','2009 IEEE International Symposium on Performance Analysis of Systems & Software (ISPASS)','ISPASS provides a forum for sharing advanced academic and industrial research work focused on performance analysis in the design of computer systems and software.  Topics include Performance evaluation methodologies, Performance analysis, Performance analysis of commercial and experimental hardware, Performance analysis of emerging workloads and software, code tuning and optimization.','http://www.ispass.org/ispass2009/',2009),(12909,1,'15394','2009 International Workshop on Intelligent Systems and Applications (ISA)','International Workshop on Intelligent Systems and Applications ISA2009 serves as a forum for researchers, industry professionals, and academics interested in intelligent systems and their applications, with the goal of fostering interaction.','http://www.ieee-ais.org.cn/',2009),(12910,1,'15395','2009 23rd International Congress on Instrumentation in Aerospace Simulation Facilities (ICIASF 2009) (POSTPONED to Spring/Summer 2011)','The 23rd International Congress on Instrumentation in Aerospace Simulation Facilities (ICIASF) continues a series of congresses which provide an important forum for international groups of scientists and engineers interested in advances in instrumentation used in all types of aerospace test facilities and in-flight measurements.','http://www.iciasf2009.cira.it',2009),(12911,1,'15396','2009 International Workshop Terahertz and Mid Infrared Radiation: Basic Research and Practical Applications (TERA-MIR 2009)','The workshop characteristic feature is a stronger emphasis on the mathematical and physical aspects of the research, together with a detail analysis of the application problems. THz and MIR are considered jointly, the driving force for both regimes being applications, however, strongly motivated by fundamental 