ing-edge developments in communication theory and technology. Attended by hundreds of professionals from around the world, the IPCC is held annually at different international locations.','http://ewh.ieee.org/soc/pcs/',2011),(13217,1,'15115','2011 IEEE LEOS Workshop on Interconnections Within High Speed Digital Systems (HSD)','Interconnections within digital computing and switching systems today are often a critical performance bottleneck. The purpose of this Workshop is to determine the interconnection requirements of emerging and future computer and communications systems and to discuss state-of-the-art solutions in wired and wireless, optical and electrical interconnection technologies. Interconnection technologies are considered at the component, packaging, and systems level.','http://www.i-leos.org',2011),(13218,1,'15138','2011 IEEE International Symposium on Information Theory - ISIT','Information Theory','http://www.isit2011.org',2011),(13219,1,'15140','2011 IEEE International Conference on Robotics and Automation (ICRA)','Advances and new results on various subjects of robotics and automation. Applications of robotics technologies','http://2011.ieee-icra.org',2011),(13220,1,'15141','2011 IEEE Radar Conference','The scope of the 2011 IEEE Radar Conference includes all aspects of civil and military radar.  Topics range from fundamental theory to cutting-edge applications, from signal processing simulation to hardware implementation and experimental results.','',2011),(13221,1,'15236','OCEANS 2011 - SPAIN','All Oceans related technologies','',2011),(13222,1,'15387','2011 Joint International Symposium on Optical Memory & Optical Data Storage (ISOM/ODS)','The Joint International Symposium on Optical Memory and Optical Data Storage 2011 (ISOM/ODS 2011)  Reflects the international nature of the interest and work in optical data storage, these two conferences are held jointly every third year. The unparalleled setting of this conference provides an outstanding opportunity to share the latest information in this dynamic field with your international colleagues. In addition to the technical sessions, a series of short courses will be presented on the latest devel','',2011),(13223,1,'15399','2011 IEEE International Conference on Systems, Man and Cybernetics - SMC','Theory, research, and technology advances including applications in all aspects of systems science and engineering, human machine systems, and emerging cybernetics.','',2011),(13224,1,'15497','2011 IEEE Congress on Evolutionary Computation (CEC)','Annual Congress on Evolutionary Computation.','',2011),(13225,1,'15542','2011 5th International IEEE/EMBS Conference on Neural Engineering (NER)','highlight the emerging field, Neural Engineering that unites engineering, physics, chemistry, mathematics, computer science with molecular, cellular, cognitive and behavioral neuroscience and encompasses such areas as replacing or restoring lost sensory and motor abilities, defining the organizing principles and underlying mechanisms of neural systems, neurorobotics, neuroelectronics, brain imaging and mapping, cognitive science and neuroscience.','',2011),(13226,1,'15545','2011 IEEE Multi-Conference on Systems and Control (MSC)','To bring together people from academia, industry, government and funding agencies. To discuss state-of-the-art in systems, control and their wide range of applications. To discuss future directions in research and development. To identify key areas of common interest.','http://www.ieee-msc2011.com',2011),(13227,1,'15610','2011 IEEE Energy Conversion Congress and Exposition (ECCE)','IEEE 3rd energy conversion conference and exposition follows the inagural event held in San Jose, CA in 2009 and 2nd meeting held in Atlanta, GA in 2010 as the premier conference dedicated to all aspects of energy processing in industrial, commercial, transportation and aerospace applications.  ECCE2011 has a strong empahasis on renewable energy sources and power conditioning, grid interactions, power quality, storage and reliability.','',2011),(13228,1,'15618','2011 18th Saint Petersburg International Conference on Integrated Navigation Systems','Sensors, systems, algorithms, satellite systems, navigation systems','http://www.elektropribor.spb.ru/',2011),(13229,1,'10053','2012 IEEE International Solid- State Circuits Conference - (ISSCC)','','http://www.isscc.org/isscc/',2012),(13230,1,'11148','2012 IEEE International Electron Devices Meeting (IEDM)','','',2012),(13231,1,'11485','2012 IEEE Petroleum and Chemical Industry Technical Conference (PCIC 2012)','','http://www.ieee-pcic.org/',2012),(13232,1,'12136','2012 Annual Reliability and Maintainability Symposium - Product Quality & Integrity (RAMS)','','http://www.rams.org',2012),(13233,1,'12471','2012 IEEE Antennas and Propagation Society International Symposium and USNC/URSI National Radio Science Meeting','This conference covers all areas relating to antenna theory, design and practice: propagation, including theory, effects and system considerations; analytical and computational electromagnetics, scattering, diffraction, and radar cross sections; and applications pertaining to antennas and propagation, such as remote sensing, applied optics, millimeter and submillimeter wave techniques, telecommunications, broadcasting, electromagnetic effects on biological tissue.','http://www.ece.uic.edu/2012aps-ursi/',2012),(13234,1,'14379','2012 IEEE/MTT-S International Microwave Symposium - MTT 2012','The IEEE International Microwave Symposium (IMS) is the world s foremost conference covering the UHF, RF, wireless, microwave, millimeter-wave, terahertz, and optical frequencies; encompassing everything from basic technologies to components to systems including the latest RFIC, MIC, MEMS and filter technologies, advances in CAD, modeling, EM simulation and more. The IMS includes technical and interactive sessions, exhibits, student competitions, panels, workshops, tutorials, and networking events.'