sing used in human interface between Robots and Personal users  will be highlighted.','',2012),(13241,1,'15510','2012 IEEE Applied Power Electronics Conference and Exposition - APEC 2012','Technical session, exhibits, seminars','http://www.apec-conf.org',2012),(13242,1,'15619','2012 19th Saint Petersburg International Conference on Integrated Navigation Systems','navigation systems, sensors, algorithms, satellite systems, guidance,inertial,gravimetry','http://www.elektropribor.spb.ru',2012),(13243,1,'15626','2012 IEEE Nuclear Science Symposium and Medical Imaging Conference (2012 NSS/MIC)','Forum for exchange of scientist and engineers working Nuclear Physics and Medical Imaging in technology and instrumentation and their implementation in experiments for particle physics, space, accelerators and other applications of radiation detection such as the technological and mathematical aspects of radiotracer-based medical imaging and other areas of non-Nuclear Molecular Imaging technologies.','http://www.nss-mic.org',2012),(13244,1,'10649','2013 IEEE/PES Transmission & Distribution Conference & Exposition','','',2013),(13245,1,'11125','2013 IEEE International Electron Devices Meeting (IEDM)','','',2013),(13246,1,'11143','2013 IEEE/MTT-S International Microwave Symposium - MTT 2013','','http://www.ims2013.org',2013),(13247,1,'11150','2013 Annual Reliability and Maintainability Symposium - Product Quality & Integrity (RAMS)','','',2013),(13248,1,'12623','2013 IEEE International Solid- State Circuits Conference - (ISSCC)','','http://www.isscc.org/isscc/futureisscc.htm',2013),(13249,1,'15226','2013 Joint Magnetism and Magnetic Materials - INTERMAG Conference','Members of the scientific and engineering communities interested in applied and fundamental magnetism are invited to contribute to the technical sessions.','',2013),(13250,1,'15304','2013 IEEE Petroleum and Chemical Industry Technical Conference (PCIC 2013)','Provide an inernational forum for the exchange of electrical 